// src/components/YachtCard.js
import React from 'react';

const YachtCard = () => {
  return (
    <div className="yacht-card">
      <img src="/path-to-yacht-image.jpg" alt="Yacht" />
      <h3>Yacht Name</h3>
      <p>Some details about the yacht.</p>
    </div>
  );
};

export default YachtCard;
